import {useState} from "react";
import "./App.css";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "23-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "23-10-10", fvk: "MD"},
  ]);
  console.log(patienter);

  //funktioner som ska vara i appen
  function deletePatient(id) {
    // const filtreradPatient = (p) => {
    //   return p.filter(p.id !== id);
    // };
    setPatienter((nuvPatienter) => {
      return nuvPatienter.filter((p) => p.id !== id);
    });
  }

  return (
    <div className="App">
      <h1>Teest</h1>
      <br />

      {/* tabell av patienter */}
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>FVK</th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((p) => {
            return (
              <tr key={p.id}>
                <td>{p.plats}</td>
                <td>{p.datum}</td>
                <td>{p.fvk}</td>
                <td>
                  <button
                    className="btn-delete"
                    onClick={() => deletePatient(p.id)}
                  >
                    X
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
